import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography } from '@mui/material';
import { scrapeProducts,  } from '../services/api';

const ProductList = ({ products, onDelete }) => {

    const handleScrapeProducts = async () => {
        const response = await scrapeProducts();
        if (response.message === "Scraper started in the background") {
            alert('Scraper started successfully');
        } else {
            alert('Error starting scraper');
        }
    };

    return (
        <TableContainer component={Paper}>
            <Typography variant="h4" component="h2" style={{ margin: '16px' }}>
                Product List
            </Typography>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>ID</TableCell>
                        <TableCell>Name</TableCell>
                        <TableCell>Image</TableCell>
                        <TableCell>Last Scraped</TableCell>
                        <TableCell>Actions</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {products.map(product => (
                        product ? (
                            <TableRow key={product.id}>
                                <TableCell>{product.id}</TableCell>
                                <TableCell>{product.name}</TableCell>
                                <TableCell>{product.image_url}</TableCell>
                                <TableCell>{product.last_updated}</TableCell>
                                <TableCell>
                                    <Button
                                        variant="contained"
                                        color="secondary"
                                        style={{ margin: '10px' }}
                                        onClick={() => onDelete(product.id)}
                                    >
                                        Delete
                                    </Button>
                                    <Button
                                        variant="contained"
                                        color="primary"
                                        onClick={() => handleScrapeProducts(product.id)}
                                    >
                                        Scrape
                                    </Button>
                                </TableCell>
                            </TableRow>
                        ) : null
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default ProductList;
